import React from "react";

function Header() {
    return (
        <div class="navbar">
        <a href="#" class="active left" > Home </a> 
        <a href="#"> Search </a> 
        <a href="#"> Contact </a> 
        <a href="#" class=""> Login </a>
        </div>
    );
}

export default Header;
